import { BrowserRouter, Route, Routes } from "react-router-dom";
import "./App.css";
import Login from "./components/Forms/Login";
function App() {
	return (
		<BrowserRouter>
			<Routes>
				<Route path="/login" element={Login} />
			</Routes>
		</BrowserRouter>
	);
}

export default App;
